INSERT INTO `btContentLocal` VALUES(197, '<p>First test blog post. We offer a range of training packages in a range of subject areas and can offer blended learning opportunities to best meet your needs. If sitting in a room with a trainer and having the opportunity for discussion with other learners sounds good to you then we can offer this. If you have enough people wanting to attend the same course then we can run one just for you. If you prefer to study in your own time and at your own speed then one of our e learning packages may be right up your street. There is a third option, which is you like the sound of both but perhaps can’t attend all training sessions, this is when blended learning comes into its own.This is the first blog post. This is a test. </p>');
INSERT INTO `btContentLocal` VALUES(199, '<p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 16px; line-height: 1.4em; font-family: sans-serif; vertical-align: baseline; color: rgb(31, 31, 31);">Welcome to The Place to Learn’s website. We pride ourselves in delivering the best education possible to our students, which is demonstrated through our Outstanding Ofsted inspection and our exam results, which for a third year in a row put us in the top 10 schools and colleges in the country.</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 16px; line-height: 1.4em; font-family: sans-serif; vertical-align: baseline; color: rgb(31, 31, 31);">As well as offering a high quality of teaching and extra-curricular activities to our students, we also have a commitment to ensure that our pupils receive the best pastoral care and support so that they feel happy and safe here and are therefore able to thrive and achieve academically. Our Student Services team are all trained to work with young people and as part of the team we have a Counsellor who specialises in children and young people’s counseling.</p><p style="margin-bottom: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; font-size: 16px; line-height: 1.4em; font-family: sans-serif; vertical-align: baseline; color: rgb(31, 31, 31);">To see more of what is on offer at The Place to Learn please explore our website further or contact us via the contact details at the top of the page.</p>');
