INSERT INTO `btContentLocal` VALUES(228, '<p>Third blog post. As well as offering a high quality of teaching and extra-curricular activities to our students, we also have a commitment to ensure that our pupils receive the best pastoral care and support so that they feel happy and safe here and are therefore able to thrive and achieve academically. </p><p>Our Student Services team are all trained to work with young people and as part of the team we have a Counsellor who specialises in children and young people’s counseling.We offer home visits to our patients that are unable to come to the surgery. This may be because they are elderly, too unwell to leave the home or have difficulty with mobility. If you think you or someone you are caring for requires a home visit please phone the surgery. One of our receptionists will arrange for a doctor to call you back to assess whether a home visit is the most appropriate course of action and if so, arrange a time to visit.</p><p><br></p><p><br></p><p><br></p>');
