INSERT INTO `btContentLocal` VALUES(310, '<h2 class="c-cta-start__heading">Ready to Get Started?</h2>\r\n    \r\n    <div class="l-cta-start-container">\r\n    \r\n    <div class="c-cta-start">\r\n    <h2 class="c-cta-start__title">100% Online and Available 24/7</h2>\r\n    <p>We believe that you should be able to receive your CPR/AED, First Aid and Blood Borne Pathogen exam courses online. We also feel that students should be able to study whenever and wherever they wish. It is our goal to help you achieve your certification in the fastest and easiest way possible.</p>\r\n    </div>\r\n    \r\n    <div class="c-cta-start">\r\n    <h2 class="c-cta-start__title">Expert Physician Created Materials</h2>\r\n    <p>At the CPR Certification Institute, we believe that you deserve the very best. This is why our entire curriculum is produced by qualified physicians. Through offering materials of the highest caliber possible, we are able to quickly prepare you for these important and life-saving tests.</p>\r\n    </div>\r\n    \r\n    <div class="c-cta-start">\r\n    <h2 class="c-cta-start__title">We Support You!</h2>\r\n    <p>In addition to our physician created practice exams and test preparation materials, we do everything possible to support you. You can keep taking your test until you pass; tests are always free. Once you pass your examination, you’ll still enjoy access to all of your training modules for 2 additional years.</p>\r\n    </div>\r\n    \r\n    </div>  \r\n    \r\n    <p class="u-center-text"><a class="button--large" href="/register">Start Now</a></p>');
