INSERT INTO `btContentLocal` VALUES(485, '<h2 class="u-center-text">Live: Uncensored Customer Reviews</h2>\r\n\r\n<p class="u-center-text"><a class="ghost-button--red" href="/">Read more reviews</a></p>\r\n\r\n<ul class="bxslider">\r\n\r\n<li class="testimonial">\r\n<p class="testimonial__time">30 minutes ago</p>\r\n<blockquote class="testimonial__bubble">Amazing! loved everything about this program. the convenience, the ease of use, and most of all the exam was thorough, yet not too difficult. thank you!</blockquote>\r\n<p class="testimonial__name">Bill Smith<br>Portland, OR</p>\r\n</li>\r\n\r\n<li class="testimonial">\r\n<p class="testimonial__time">58 minutes ago</p>\r\n<blockquote class="testimonial__bubble">Concise. efficient. got done in several hours. will recommend others.</blockquote>\r\n<p class="testimonial__name">Mary Jones<br>Ithaca, NY</p>\r\n</li>\r\n\r\n<li class="testimonial">\r\n<p class="testimonial__time">6 minutes ago</p>\r\n<blockquote class="testimonial__bubble">Enjoyed the convenience...my work paid for it but I still would have preferred some hands-on component. Overall, good experience.</blockquote>\r\n<p class="testimonial__name">John Doe<br>Whiting, Kansas</p>\r\n\r\n<li class="testimonial">\r\n<p class="testimonial__time">2 hours ago</p>\r\n<blockquote class="testimonial__bubble">It’s a good thing you offer unlimited practice exams, because I needed them. Loved the ease and flexibility of this program.</blockquote>\r\n<p class="testimonial__name">Sean E.<br>Willard, New Mexico</p>\r\n</li>\r\n</ul>');
