INSERT INTO `C5CBT_cert_questions` VALUES(1, NULL, 'The correct sequence for basic life support is:', 'a:4:{i:0;s:32:"Airway, Breathing, Compressions ";i:1;s:31:"Breathing, Airway, Compression ";i:2;s:31:"Compressions, Airway, Breathing";i:3;s:31:"Breathing, Compressions, Airway";}', 2, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(2, NULL, 'When assessing the victim, you should remember to look, listen and feel for breathing.', 'a:2:{i:0;s:4:"True";i:1;s:5:"False";}', 1, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(3, NULL, 'For any victim, the correct compression rate is:', 'a:4:{i:0;s:23:"At least 120 per minute";i:1;s:22:"At least 80 per minute";i:2;s:23:"At least 90 per minute ";i:3;s:21:"100 to 120 per minute";}', 3, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(4, NULL, 'The recommended compression depth for an adult is:', 'a:4:{i:0;s:6:"1 inch";i:1;s:10:"1.5 inches";i:2;s:17:"At least 2 inches";i:3;s:30:"None of the above are correct ";}', 2, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(5, NULL, 'If performing rescue breathing, you should:', 'a:4:{i:0;s:27:"Avoid excessive ventilation";i:1;s:33:"Provide a breath every 2 seconds ";i:2;s:48:"Do not allow the chest to expand between breaths";i:3;s:28:"All of the above are correct";}', 0, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(6, NULL, 'When assessing the victim, you should feel for a pulse for:', 'a:4:{i:0;s:9:"3 seconds";i:1;s:12:"5-10 seconds";i:2;s:13:"15-20 seconds";i:3;s:13:"20-30 seconds";}', 1, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(7, NULL, 'The correct sequence in the AHA Adult Chain of Survival is:', 'a:4:{i:0;s:109:"Activate the emergency response system; CPR; Defibrillation; Advanced Life Support; Post-Cardiac arrest care ";i:1;s:108:"Activate the emergency response system; CPR; Advanced Life Support; Defibrillation; Post-Cardiac arrest care";i:2;s:110:"Activate the emergency response system; Defibrillation; CPR; Advanced life support; Post- Cardiac arrest care.";i:3;s:108:"Advanced Life Support; Activate the emergency response system; CPR; Defibrillation; Post-Cardiac arrest care";}', 0, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(8, NULL, 'If you are alone and come upon a person who may need CPR, the FIRST thing you should do is:', 'a:4:{i:0;s:38:"Activate the emergency response system";i:1;s:10:"Begin CPR ";i:2;s:13:"Go for an AED";i:3;s:27:"Make sure the scene is safe";}', 3, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(9, NULL, 'Assessing the victim includes all of the following EXCEPT:', 'a:4:{i:0;s:19:"Shake his shoulder ";i:1;s:36:"Look, listen and feel for breathing ";i:2;s:26:"Yell at him/Call his name ";i:3;s:22:"Observe his breathing ";}', 1, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(10, NULL, 'You are alone and find an unconscious victim on the ground who may need CPR. The scene is safe. You assess the victim and determine he is not breathing and will not awaken. You should:', 'a:4:{i:0;s:13:"Call for help";i:1;s:25:"Start chest compressions ";i:2;s:17:"Check for a pulse";i:3;s:22:"Begin rescue breathing";}', 0, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(11, NULL, 'The best place to try to find a pulse in an adult is:', 'a:4:{i:0;s:36:"The femoral artery in the upper leg ";i:1;s:36:"The brachial artery in the upper arm";i:2;s:42:"The carotid artery on the side of the neck";i:3;s:49:"The radial artery on the thumb side of the wrist ";}', 2, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(12, NULL, 'The general public should never attempt to do rescue breathing.', 'a:2:{i:0;s:4:"True";i:1;s:5:"False";}', 1, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(13, NULL, 'If you are performing rescue breathing for an adult victim with a pulse, you should do all of the following EXCEPT:', 'a:4:{i:0;s:33:"Check for a pulse every 2 minutes";i:1;s:46:"Open the airway by using a head tilt/chin lift";i:2;s:37:"Use a barrier or mask if you have one";i:3;s:85:"With your index finger, sweep the victims mouth to ensure there are no foreign bodies";}', 3, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(14, NULL, 'When performing rescue breathing, each breath should last:', 'a:4:{i:0;s:8:"1 second";i:1;s:10:"2 seconds ";i:2;s:9:"5 seconds";i:3;s:10:"10 seconds";}', 0, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(15, NULL, 'You and a friend are walking when you see an elderly man collapse in front of you. There are no hazards around. You assess the man and determine that he is unconscious and is not breathing. You should direct your friend to:', 'a:4:{i:0;s:15:"Check the pulse";i:1;s:9:"Begin CPR";i:2;s:38:"Activate the emergency response system";i:3;s:15:"Open the airway";}', 2, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(16, NULL, 'If you have 2 rescuers for an adult victim and one or both are comfortable giving rescue breaths, the correct ratio of compressions to breaths is:', 'a:4:{i:0;s:25:"15 compressions: 1 breath";i:1;s:27:"15 compressions: 2 breaths ";i:2;s:25:"30 compressions: 1 breath";i:3;s:26:"30 compressions: 2 breaths";}', 3, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(17, NULL, 'During CPR, if the victims chest does not rise after two attempts to give breaths, you should:', 'a:4:{i:0;s:53:"Attempt to give breaths until you see the chest rise ";i:1;s:46:"Readjust the head using a jaw thrust maneuver ";i:2;s:35:"Blow harder into the victims mouth ";i:3;s:30:"Start chest compressions again";}', 3, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(18, NULL, 'If an adult victim has a pulse but is not breathing, you should perform rescue breathing.  For an adult victim, you should provide a breath:', 'a:4:{i:0;s:17:"Every 1-2 seconds";i:1;s:17:"Every 3-5 seconds";i:2;s:17:"Every 5-6 seconds";i:3;s:17:"Every 10 seconds ";}', 2, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(19, NULL, 'The recovery position should be used for a victim who is:', 'a:4:{i:0;s:25:"Breathing and has a pulse";i:1;s:35:"Breathing but does not have a pulse";i:2;s:7:"Choking";i:3;s:30:"None of the above are correct.";}', 0, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(20, NULL, 'You are assisting a choking victim. You have attempted abdominal thrusts and the victim has just lost consciousness. You have assisted the victim to the ground. You should now:', 'a:4:{i:0;s:13:"Call for help";i:1;s:24:"Begin chest compressions";i:2;s:28:"Perform a blind finger sweep";i:3;s:37:"Continue to perform abdominal thrusts";}', 0, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(21, NULL, 'Ventricular fibrillation:', 'a:4:{i:0;s:33:"Is a rare cause of cardiac arrest";i:1;s:29:"Cannot be treated with an AED";i:2;s:75:"Is a lethal rhythm in which the ventricles quiver in an unorganized fashion";i:3;s:44:"Often occurs before ventricular tachycardia ";}', 2, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(22, NULL, 'The correct order of steps involved in operating an AED are:', 'a:4:{i:0;s:48:"Push ON; Press SHOCK; Press ANALYZE; Attach Pads";i:1;s:48:"Attach Pads; Push ON; Press SHOCK; Press ANALYZE";i:2;s:48:"Attach Pads; Press SHOCK; Press ANALYZE; Push ON";i:3;s:48:"Push ON; Attach Pads; Press ANALYZE; Press SHOCK";}', 3, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(23, NULL, 'It is dangerous to defibrillate a victim if the victims chest is wet.', 'a:2:{i:0;s:4:"True";i:1;s:5:"False";}', 1, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(24, NULL, 'For every minute that defibrillation is delayed, chance of survival is reduced by ______%.', 'a:4:{i:0;s:3:"20%";i:1;s:3:"30%";i:2;s:2:"5%";i:3;s:3:"10%";}', 3, 1, 1);
INSERT INTO `C5CBT_cert_questions` VALUES(25, NULL, 'You are eating a meal in a restaurant when a pregnant woman at the next table begins to choke. She is conscious but unable to speak. You should:', 'a:4:{i:0;s:51:"Perform chest thrusts until she expels the object  ";i:1;s:53:"Perform abdominal thrusts until she expels the object";i:2;s:68:"Wait until she loses consciousness, then perform chest compressions ";i:3;s:62:"Call for help but do not interfere- you could injure the fetus";}', 0, 1, 1);
