INSERT INTO `C5CBT_reviews` VALUES(92, 'Ruth G.', '', 5, 'The best bet for your time and your money.', 'Slater, Wyoming', '', 1, 1, '2016-06-24 19:31:14');
INSERT INTO `C5CBT_reviews` VALUES(93, 'Jay H.', '', 5, 'This program was well-structured and well-organized.  I passed with flying colors.', 'Lehr, North Dakota', '', 1, 1, '2016-06-24 22:38:41');
INSERT INTO `C5CBT_reviews` VALUES(94, 'Violet M.', '', 3, 'The recertification was a breeze.', 'La Crosse, Washington', '', 1, 1, '2016-06-26 03:45:27');
INSERT INTO `C5CBT_reviews` VALUES(95, 'Elvia M.', '', 3, 'I really didn’t think I’d pass on the first try, but I did.  Nice job on your materials.\r\n', 'Westport, Oklahoma', '', 1, 1, '2016-06-26 12:44:28');
INSERT INTO `C5CBT_reviews` VALUES(96, 'Jerome T.', '', 5, 'I needed my certification right away to get a great job and your program provided the perfect timing at the right time. ', 'Cal-nev-ari, Nevada', '', 1, 1, '2016-06-26 15:23:49');
INSERT INTO `C5CBT_reviews` VALUES(97, 'Roberta A.', '', 5, 'Super and awesome.', 'Heidelberg, Mississippi', '', 1, 1, '2016-06-27 11:14:19');
INSERT INTO `C5CBT_reviews` VALUES(98, 'Jason F.', '', 5, 'Sooooo fast and convenient.', 'Cranston, Rhode Island', '', 1, 1, '2016-06-27 17:48:00');
INSERT INTO `C5CBT_reviews` VALUES(99, 'Justin L.', '', 5, 'I loved that I could do the whole course on my phone. This was a big surprise.', 'Twin Bridges, Montana', '', 1, 1, '2016-06-27 20:44:59');
INSERT INTO `C5CBT_reviews` VALUES(100, 'Jody S.', '', 4, 'No check of clinical skills! Right on guys.', 'Rio Rico Southwest, Arizona', '', 1, 1, '2016-06-28 03:47:41');
INSERT INTO `C5CBT_reviews` VALUES(101, 'Antonio R.', '', 4, 'If you’re looking for personal training recertification this is your best bet.', 'Truth Or Consequences, New Mexico', '', 1, 1, '2016-06-29 05:47:04');
INSERT INTO `C5CBT_reviews` VALUES(102, 'Mark E.', '', 3, 'Easy, convenient, fast. I only have good things to say about this course and test.', 'Isleta Village Proper, New Mexico', '', 1, 1, '2016-06-30 11:28:42');
INSERT INTO `C5CBT_reviews` VALUES(103, 'Rueben C.', '', 5, 'My new card looks pretty darn snazzy. Thanks Personal Training Certification institute!', 'Big Timber, Montana', '', 1, 1, '2016-07-01 09:25:21');
INSERT INTO `C5CBT_reviews` VALUES(104, 'Karl M.', '', 5, 'This was enjoyable and that’s why I’m in the personal training industry in the first place. Thanks for making my training and testing pleasant.', 'Bazile Mills, Nebraska', '', 1, 1, '2016-07-02 05:57:41');
INSERT INTO `C5CBT_reviews` VALUES(105, 'Pollyanna C.', '', 5, 'I could tell a lot of time and attention went into the creation of this course. You can easily see that medical experts truly created it. I plan to pass along these benefits to my clients.', 'Taylor, Arizona', '', 1, 1, '2016-07-03 14:20:34');
INSERT INTO `C5CBT_reviews` VALUES(106, 'Karamy R.', '', 5, 'Im so glad I handled my recert online. It was so painless and I was able to study and even take the test on the go. Major benefits.', 'Overton, Nebraska', '', 1, 1, '2016-07-04 19:12:13');
INSERT INTO `C5CBT_reviews` VALUES(107, 'Alyssa C.', '', 5, 'This was convenient and a very good value for the money.', 'Pasadena, Maryland', '', 1, 1, '2016-07-05 07:30:20');
INSERT INTO `C5CBT_reviews` VALUES(108, 'Suzy B.', '', 5, 'These guys are the best.', 'Boulder Creek, California', '', 1, 1, '2016-07-05 15:54:06');
INSERT INTO `C5CBT_reviews` VALUES(109, 'Kris S.', '', 4, '5 Stars. Rock on!', 'New Milford, Connecticut', '', 1, 1, '2016-07-06 22:40:09');
INSERT INTO `C5CBT_reviews` VALUES(110, 'Sunny W.', '', 5, 'A decent way to renew my certification. However I wish the process had gone a little faster.', 'Williamsfield, Illinois', '', 1, 1, '2016-07-08 08:02:15');
INSERT INTO `C5CBT_reviews` VALUES(111, 'Michael B.', '', 5, 'I’ll be back for more when my certification runs out. Thank you!', 'Central City, Nebraska', '', 1, 1, '2016-07-09 00:01:52');
INSERT INTO `C5CBT_reviews` VALUES(112, 'Jessica A.', '', 5, 'The fact I could finish not only studying but also taking the test and passing made me feel like quite a bad ass! &#9786;', 'Oakley, Wyoming', '', 1, 1, '2016-07-09 17:16:29');
INSERT INTO `C5CBT_reviews` VALUES(113, 'Monica C.', '', 4, 'I’m really pleased that one of my colleagues recommended the Personal Training Certification Institute to me. This was much easier to pass than I expected.', 'Cody, Wyoming', '', 1, 1, '2016-07-10 10:45:03');
INSERT INTO `C5CBT_reviews` VALUES(114, 'Linda T.', '', 5, 'I’m pretty bad on tests, but I managed to pass yours on the first try. I think that means that your study materials are really good. So thanks.', 'Kalihiwai, Hawaii', '', 1, 1, '2016-07-10 13:38:57');
INSERT INTO `C5CBT_reviews` VALUES(115, 'Cassie A.', '', 5, 'My card arrived today and I put it right in my wallet. I look forward to helping my clients with their fitness goals in the best way possible.', 'Mountain Park, Georgia', '', 1, 1, '2016-07-11 12:12:41');
INSERT INTO `C5CBT_reviews` VALUES(116, 'Jerry G.', '', 4, 'One word for you guys: typos.', 'Lugoff, South Carolina', '', 0, 1, '2016-07-11 12:36:27');
INSERT INTO `C5CBT_reviews` VALUES(117, 'Marc L.', '', 5, 'My friends were complaining the other day about how hard it is to recertify and I just sat their smiling because I had gotten my recert through your program.  I think I’ll keep it my little secret.', 'Woolsey, Georgia', '', 1, 1, '2016-07-11 17:48:14');
INSERT INTO `C5CBT_reviews` VALUES(118, 'Leslie P.', '', 3, 'I have to say your customer service really surprised me. I didn’t expect anyone to answer my question so quickly.  A+ for professionalism.', 'Arroyo, Puerto Rico', '', 1, 1, '2016-07-12 06:48:30');
INSERT INTO `C5CBT_reviews` VALUES(119, 'Meredith F.', '', 5, 'Very fast, very streamlined.', 'Windsor, Wisconsin', '', 1, 1, '2016-07-12 21:26:35');
INSERT INTO `C5CBT_reviews` VALUES(120, 'David M.', '', 5, 'I passed on my first try, but I was actually hoping to learn a bit more from your program. I think it might actually be too easy. I genuinely only want qualified pros in this field. ', 'Cumberland Hill, Rhode Island', '', 1, 1, '2016-07-14 02:32:00');
INSERT INTO `C5CBT_reviews` VALUES(121, 'Mike T.', '', 5, 'Three thumbs up! ', 'Arlington, Vermont', '', 1, 1, '2016-07-15 04:59:55');
INSERT INTO `C5CBT_reviews` VALUES(122, 'Nate G.', '', 5, 'Yay, I did it!  Great materials.', 'Kendrick, Idaho', '', 1, 1, '2016-07-15 18:06:08');
INSERT INTO `C5CBT_reviews` VALUES(123, 'Joe P.', '', 5, 'I studied and passed on the train today. This was seriously learning on the go.', 'Hawesville, Kentucky', '', 1, 1, '2016-07-16 08:58:19');
INSERT INTO `C5CBT_reviews` VALUES(124, 'Cameron A.', '', 5, 'Very comprehensive and thorough. I appreciated the fact that I could learn at my own pace. I have a short attention span.', 'South Sanford, Maine', '', 1, 1, '2016-07-16 15:02:14');
INSERT INTO `C5CBT_reviews` VALUES(125, 'Gwynne M.', '', 5, 'Far more professional than your competitors. ', 'Fort Kent, Maine', '', 1, 1, '2016-07-17 04:59:16');
INSERT INTO `C5CBT_reviews` VALUES(126, 'David F.', '', 5, 'I found you while searching for ways to gain my training certification. I was pleasantly surprised that this can all be done online. It was a great find and now I’m recommending your course to everyone. ', 'Rodney Village, Delaware', '', 1, 1, '2016-07-17 09:35:20');
INSERT INTO `C5CBT_reviews` VALUES(127, 'Sara Y.', '', 5, 'Years ago, I was afraid to become a personal trainer because I worried about all the required certifications, but you guys made it a breeze.  Thanks.', 'Bellevue, WA', 'Pro Sports Club', 1, 1, '2016-07-17 11:00:34');
INSERT INTO `C5CBT_reviews` VALUES(128, 'Israel G.', '', 5, 'My passion is helping people with their bodies at the gym, not taking tests.  But this was a decent option.', 'Silverton, Oregon', 'Lifetime Fitness', 1, 1, '2016-07-17 19:00:33');
INSERT INTO `C5CBT_reviews` VALUES(129, 'Renee J.', '', 5, 'Nice job. This is an awesome platform for testing for personal trainers!!', 'Tiverton, Rhode Island', 'Fitness Together', 1, 1, '2016-07-18 02:47:24');
INSERT INTO `C5CBT_reviews` VALUES(130, 'Pam C.', '', 4, 'Excellent materials, excellent course.', 'Poultney, Vermont', 'Golds Gym', 1, 1, '2016-07-18 11:55:12');
INSERT INTO `C5CBT_reviews` VALUES(131, 'Theresa H.', '', 5, 'I would do it all again in a heartbeat. I loved this program. I plan to try the bootcamp certification next!', 'Lake Barcroft, Virginia', 'UVA Medical', 1, 1, '2016-07-18 23:17:41');
INSERT INTO `C5CBT_reviews` VALUES(132, 'Sean E.', '', 5, 'It’s a good thing you offer unlimited practice exams, because I needed them. Loved the ease and flexibility of this program.', 'Hillsboro, North Dakota', 'Private Trainer ', 1, 1, '2016-07-19 15:24:11');
INSERT INTO `C5CBT_reviews` VALUES(133, 'John P.', '', 4, 'I had to retake the test 3 times before I passed. But that''s not really your fault, I suck at taking tests.', 'Willard, New Mexico', 'LA Fitness', 0, 1, '2016-07-19 20:06:46');
INSERT INTO `C5CBT_reviews` VALUES(134, 'A l.', '', 5, 'Second time using this program from my personal training certification. Easy and convenient. ', 'Whiting, Kansas', '24 Hour Fitness', 1, 1, '2016-07-20 03:20:57');
INSERT INTO `C5CBT_reviews` VALUES(135, 'Aaron I.', '', 5, 'I liked that I instantly got my test results. Was recommended by Nick Korpi at Columbia Athetlic Club, so please provide him referral award.', 'Kirkland, WA', 'Columbia Athletic Club', 1, 1, '2016-07-21 06:59:20');
INSERT INTO `C5CBT_reviews` VALUES(138, 'Desmond W.', 'Personal Trainer', 4, 'Enjoyed the convenience...my work paid for it but I still would have preferred some hands-on component. Overall, good experience. ', 'Miami, Florida', 'LA Fitness', 1, 1, '2016-08-18 07:20:41');
INSERT INTO `C5CBT_reviews` VALUES(139, 'Nicole H.', 'Pilates Instructor and CPT', 5, 'Awesome! Recommended by my gym and glad I tried it out. I tried passing NASM, but failed twice...their questions are necessarily tricky. Thanks for everything. PS - your customer support rocks!!! :)', 'Chanhassen, MN', 'Lifetime Fitness', 1, 1, '2016-08-18 07:24:21');
INSERT INTO `C5CBT_reviews` VALUES(140, 'Alison T.', 'Personal Trainer', 3, 'Online is just not for me. Thought it would be, but I learn better in-person. It was easy to use and navigate though.', 'Ithaca, NY', 'Private Trainer', 0, 1, '2016-08-18 07:26:15');
