INSERT INTO `PageSearchIndex` VALUES(278, 'Main Sidebar Stack This is a group of blocks known as a "stack" and automatically added to all pages. To edit the contents, find the "Stacks & Blocks" page in the admin dashboard and edit the "Sidebar" Stack. \r\n    Why choose us?\r\n    \r\n        Largest ACLS Provider in the US\r\n        Nationally & Internationally Accepted\r\n        Course & Exam Written ny MD''s\r\n        Unlimited Practice Exams\r\n    \r\n    View More\r\n \r\n    Preview Our Course\r\n    \r\n        100% Online ACLS Course\r\n        Online Provider Manual Included\r\n        No Other Study Material Required\r\n        No On-Site Clinical Skills Check\r\n        Unlimited Unique Practice Exams\r\n        Study Guide Written By MDs\r\n        Based on Latest AHA Guidelines\r\n        Take the Exam Anytime You Wish\r\n    \r\n    View More\r\n  ', 'Shopping Cart', '', '/shopping-cart', '2016-11-13 14:40:54', '2016-11-13 14:41:58', NULL, 0);
