INSERT INTO `PageSearchIndex` VALUES(174, ' First test blog post. We offer a range of training packages in a range of subject areas and can offer blended learning opportunities to best meet your needs. If sitting in a room with a trainer and having the opportunity for discussion with other learners sounds good to you then we can offer this. If you have enough people wanting to attend the same course then we can run one just for you. If you prefer to study in your own time and at your own speed then one of our e learning packages may be right up your street. There is a third option, which is you like the sound of both but perhaps can’t attend all training sessions, this is when blended learning comes into its own.This is the first blog post. This is a test.\n  First test blog post. We offer a range of training packages in a range of subject areas and can offer blended learning opportunities to best meet your needs. If sitting in a room with a trainer and having the opportunity for discussion with other learners sounds good to you then we can offer this. If you have enough people wanting to attend the same course then we can run one just for you. If you prefer to study in your own time and at your own speed then one of our e learning packages may be right up your street. There is a third option, which is you like the sound of both but perhaps can’t attend all training sessions, this is when blended learning comes into its own.This is the first blog post. This is a test. \n  First test blog post. We offer a range of training packages in a range of subject areas and can offer blended learning opportunities to best meet your needs. If sitting in a room with a trainer and having the opportunity for discussion with other learners sounds good to you then we can offer this. If you have enough people wanting to attend the same course then we can run one just for you. If you prefer to study in your own time and at your own speed then one of our e learning packages may be right up your street. There is a third option, which is you like the sound of both but perhaps can’t attend all training sessions, this is when blended learning comes into its own.This is the first blog post. This is a test.\n  \r\n\r\nBlog\r\n \r\n\r\n \r\n ', 'First Blog Post', 'First test blog post. We offer a range of training packages in a range of subject areas and can offer blended learning opportunities to best meet your needs. If sitting in a room with a trainer and having the opportunity for discussion with other learners sounds good to you then we can offer this. If you have enough people wanting to attend the same course then we can run one just for you.', '/blog/first-blog-post', '2016-10-06 14:29:00', '2016-10-07 20:11:55', NULL, 0);
INSERT INTO `PageSearchIndex` VALUES(175, 'Welcome to The Place to Learn’s website. We pride ourselves in delivering the best education possible to our students, which is demonstrated through our Outstanding Ofsted inspection and our exam results, which for a third year in a row put us in the top 10 schools and colleges in the country.\n   As well as offering a high quality of teaching and extra-curricular activities to our students, we also have a commitment to ensure that our pupils receive the best pastoral care and support so that they feel happy and safe here and are therefore able to thrive and achieve academically. Our Student Services team are all trained to work with young people and as part of the team we have a Counsellor who specialises in children and young people’s counseling.\n   To see more of what is on offer at The Place to Learn please explore our website further or contact us via the contact details at the top of the page.    \r\n\r\nBlog\r\n \r\n\r\n \r\n ', 'Second Blog Post', 'Another test blog post. Welcome to The Place to Learn’s website. We pride ourselves in delivering the best education possible to our students, which is demonstrated through our Outstanding Ofsted inspection and our exam results, which for a third year in a row put us in the top 10 schools and colleges in the country.', '/blog/second-blog-post', '2016-10-06 14:53:00', '2016-10-07 20:11:31', NULL, 0);
