INSERT INTO `PageSearchIndex` VALUES(176, ' Third blog post. As well as offering a high quality of teaching and extra-curricular activities to our students, we also have a commitment to ensure that our pupils receive the best pastoral care and support so that they feel happy and safe here and are therefore able to thrive and achieve academically.   Our Student Services team are all trained to work with young people and as part of the team we have a Counsellor who specialises in children and young people’s counseling.We offer home visits to our patients that are unable to come to the surgery. This may be because they are elderly, too unwell to leave the home or have difficulty with mobility. If you think you or someone you are caring for requires a home visit please phone the surgery. One of our receptionists will arrange for a doctor to call you back to assess whether a home visit is the most appropriate course of action and if so, arrange a time to visit.           \r\n\r\nBlog\r\n \r\n\r\n \r\n ', 'Third Blog Post', 'Third blog post. As well as offering a high quality of teaching and extra-curricular activities to our students, we also have a commitment to ensure that our pupils receive the best pastoral care and support so that they feel happy and safe here and are therefore able to thrive and achieve academically.', '/blog/third-blog-post', '2016-10-06 22:23:00', '2016-10-07 20:11:12', NULL, 0);
INSERT INTO `PageSearchIndex` VALUES(177, '\r\n  CPR/AED\r\n  First Aid\r\n  CPR/AED/First Aid\r\n  Bloodborne Pathogens\r\n  Infant CPR\r\n  Wilderness First Aid\r\n FAQ  We are a small clinic that has been in business for 15 years.  We have 4 treatment rooms and a comfortable waiting area with receptionist. We are a private practice and we treat patients of all ages.\r\n \r\n If you are planning on visiting us for the first time, please allow 45 minutes for your initial appointment and you will need to arrive 10 minutes before your appointment time to complete some paperwork. Our aim at this initial appointment and any future appointments that may follow, is to identify the problem and start working on it to make you feel better. We will also work with you to identify ways in which you could improve your condition between appointments.\r\n \r\n We look forward to meeting you and also to sending you on your way again, hopefully with a spring in your step.\r\n  ', 'FAQ', '', '/faq', '2016-10-07 19:46:19', '2016-10-10 17:17:02', NULL, 0);
